const Header = () => {
    return (
        <>
        <div className='header'>
            <h1>Stranger's Things</h1>
        </div>
        <nav className='nav'>
            <Link to="/">HOME</Link>
            <Link to="/posts">POSTS</Link>
            <Link to="/login">LOGIN</Link>
        </nav>
        </>
    )
}

export default Header;
